// ignore_for_file: lines_longer_than_80_chars

import 'dart:convert';
import 'dart:typed_data';
import 'dart:ui' as ui;

class AppFonts {
  AppFonts._();

  static bool _loaded = false;

  static Future<void> ensureLoaded() async {
    if (_loaded) {
      return;
    }
    final loader = ui.FontLoader('New Science')
      ..addFont(_decode(_newScienceRegular))
      ..addFont(_decode(_newScienceMedium))
      ..addFont(_decode(_newScienceBold));
    await loader.load();
    _loaded = true;
  }

  static Future<ByteData> _decode(String encoded) async {
    final bytes = base64Decode(encoded);
    return ByteData.view(Uint8List.fromList(bytes).buffer);
  }
}

const String _newScienceRegular =
""
;
const String _newScienceMedium =
""
;
const String _newScienceBold =
""
;
